import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import LOGO from '../assets/LOGO.svg';

function Navbar() {
  const location = useLocation();

  return (
    <div className="w-full px-8 py-4 border border-gray-800 rounded-lg flex flex-row justify-between ">
      <Link 
        to="/" 
        className="w-9">
        <img src={LOGO} alt="LOGO" />
      </Link>
      <div className="flex flex-row gap-20 items-center md:hidden">
        <Link
          to="/profile"
          className={`hover:underline ${
            location.pathname === '/profile' ? 'text-blue-500 font-semibold' : ''
          }`}
        >
          PROFILE
        </Link>
        <Link
          to="/education"
          className={`hover:underline ${
            location.pathname === '/education' ? 'text-blue-500 font-semibold' : ''
          }`}
        >
          EDUCATION
        </Link>
        <Link
          to="/projects"
          className={`hover:underline ${
            location.pathname === '/projects' ? 'text-blue-500 font-semibold' : ''
          }`}
        >
          PROJECTS
        </Link>
      </div>
      <div className="contact">
        <Link
          to="/contact"
          className={`hover:underline ${
            location.pathname === '/contact' ? 'text-blue-500 font-semibold' : ''
          }`}
        >
          <button>CONTACT</button>
        </Link>
      </div>
    </div>
  );
}

export default Navbar;
